import React, { Fragment, useEffect, useState } from "react";

const MidTier = () => {
    const [todos, setTodos] = useState([]);

    const getHardware = async () => {
        try {
            const response = await fetch("http://localhost:3080/see/motherboard");
            const jsonData = await response.json();

            setTodos(jsonData);
        } catch (err) {
            console.error(err.message);
        }
    };

    useEffect(() => {
        getHardware();
    }, []);

    console.log(todos);

    return (
        <Fragment>

            <div class="row py-0">
                <div class="col-lg-7 col-md-10 col-sm-10 ">
                    <div class="single-project">
                        <img src="images/rekomendasi/midtier.jpg" alt="" class="img-fluid">
                        </img>
                    </div>
                </div>
                <div class="col-lg-4 col-md-12 col-sm-12 ">
                    <div class="project-content-block">
                        <h2>Mid Tier</h2>
                        <p>Explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and we will give you a complete account of the system.</p>
                    </div>
                </div>
            </div>
            <pre class="tab"> </pre>
            <pre class="tab"> </pre>
        </Fragment>
    );
};

export default MidTier;
